import styled from "@emotion/styled";
import { mq } from "../../styles/globalStyle";

export const Li = styled.li`
  align-items: center;
  margin-top: 1rem;
  cursor: pointer;
`;

export const Ul = styled.ul`
  flex-wrap: wrap;
  justify-content: space-between;

  ${mq[0]} {
    padding-top: 1.2rem;
    padding-bottom: 1.2rem;
  }

  ${mq[3]} {
    padding-top: 2.5rem;
    padding-bottom: 2.5rem;
  }
`;
